import React from 'react';
import classes from './Home.module.css';


function DetailsModal() {
  return (
    <dialog className={classes["info-modal"]} open>
        <h2>You Lost!</h2>
        <p>Hellow Wprld!</p>
        <form method="dialog">
            <button>Close</button>
        </form>
    </dialog>
  )
};

export default DetailsModal;
